import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Join multiple events using discovered event codes
    const eventCodes = ['CODE1', 'CODE2', 'CODE3']; // Example event codes
    for (const code of eventCodes) {
      // Wait for the join event button to be visible and click it
      await page.waitForSelector('button.btn.btn-secondary.btn-large');
      await page.click('button.btn.btn-secondary.btn-large');

      // Wait for the event code input field to be visible and type the event code
      await page.waitForSelector('#eventCode');
      await page.fill('#eventCode', code);

      // Wait for the participant name input field to be visible and type a name
      await page.waitForSelector('#participantName');
      await page.fill('#participantName', 'Test User');

      // Click the join event button
      await page.waitForSelector('button.btn.btn-primary');
      await page.click('button.btn.btn-primary');

      // Take a screenshot after joining the event
      await page.waitForTimeout(1000); // Wait for any potential loading
      await page.screenshot({ path: path.join(screenshotsDir, `step_join_event_${code}.png`) });
      screenshots.push(path.join(screenshotsDir, `step_join_event_${code}.png`));

      // Optionally, wait for a response or confirmation message
      await page.waitForTimeout(2000); // Adjust based on response time
    }

    return {
      success: true,
      action: "Successfully joined multiple events using discovered event codes",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

